import React from "react";
import { Form, Button } from "react-bootstrap";
import {useFormik} from 'formik'

const Registration = () => {

    const initialValues={
        name:'',
        email:'',
        password:'',
        confirm_password:''
    }


    const {values, errors, handleBlur, handleChange, handleSubmit} = useFormik({
        initialValues:initialValues,
        onSubmit:(values)=>{
            console.log('values are',values);
        }
    })

    console.log(values);


  return (
    <React.Fragment>
      <Form>
      <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Name</Form.Label>
          <Form.Control autoComplete="off" type="text" name="name" placeholder="Enter name" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control autoComplete="off" type="email" name="email" placeholder="Enter email" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control autoComplete="off" type="password" name="password" placeholder="Password" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Confirm Password</Form.Label>
          <Form.Control autoComplete="off" type="password" name="confirm_password" placeholder="Confirm Password" />
        </Form.Group>

        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </React.Fragment>
  );
};

export default Registration;
